import React from 'react';
import './App.css';
import Nav from './Nav.js'
import Blog from './Blog.js'
import About from './About.js'

function App() {
  return (
    <div className="App">
      <Nav />
      <About />
      <Blog />
    </div>
  );
}

export default App;
